import Box from "@mui/material/Box";
import { TreeViewBaseItem } from "@mui/x-tree-view/models";
import { RichTreeView } from "@mui/x-tree-view/RichTreeView";

const treeTag = () => {
  return <div onClick={(e) => {}}>yea</div>;
};

const MUI_X_PRODUCTS = [
  {
    id: "phonemes",
    label: "phonemes",
    children: [
      {
        id: "vowels",
        label: "vowels",
        children: [
          {
            id: "unrounded",
            label: "unrounded",
            children: [
              {
                id: "front",
                label: "front",
                children: [
                  { id: "i", label: "i" },
                  { id: "e", label: "e" },
                  { id: "ɛ", label: "ɛ" },
                  { id: "æ", label: "æ" },
                  { id: "a", label: "a" },
                ],
              },
              {
                id: "near-front",
                label: "near-front",
                children: [{ id: "ɪ", label: "ɪ" }],
              },
              { id: "central", label: "central" },
              { id: "back", label: "back" },
            ],
          },
          {
            id: "rounded",
            label: "rounded",
            children: [
              { id: "front2", label: "front" },
              { id: "near-front2", label: "near-front" },
              { id: "central2", label: "central" },
              { id: "near-back2", label: "near-back" },
              { id: "back2", label: "back" },
            ],
          },
        ],
      },
      { id: "consonants", label: "consonants" },
      { id: "other", label: "other" },
    ],
  },
];

function PhonemeDropDown() {
  return (
    <Box
      sx={{
        minHeight: 33,
        flexGrow: 1,
        backgroundColor: "white",
        boxShadow: "5px 5px 10px gray",
        borderRadius: "5px",
        overflowY: "scroll",
        overflow: "auto",
        maxHeight: "65%",
      }}
      className="phone-drop"
    >
      <RichTreeView items={MUI_X_PRODUCTS} />
    </Box>
  );
}

export default PhonemeDropDown;
